import{_ as e,o as t,c as a,a as r}from"./app.57a3dbd1.js";const u=JSON.parse('{"title":"Global parameters","description":"","frontmatter":{"contributors":["ZhouYixun"]},"headers":[{"level":2,"title":"Usage and built-in parameters","slug":"usage-and-built-in-parameters","link":"#usage-and-built-in-parameters","children":[]},{"level":2,"title":"Special usage","slug":"special-usage","link":"#special-usage","children":[]},{"level":2,"title":"Add global parameters","slug":"add-global-parameters","link":"#add-global-parameters","children":[]},{"level":2,"title":"Edit global parameters","slug":"edit-global-parameters","link":"#edit-global-parameters","children":[]},{"level":2,"title":"Delete global parameters","slug":"delete-global-parameters","link":"#delete-global-parameters","children":[]}],"relativePath":"en/doc/doc-global.md","lastUpdated":1716537034000}'),l={name:"en/doc/doc-global.md"},i=r('<h1 id="global-parameters" tabindex="-1">Global parameters <a class="header-anchor" href="#global-parameters" aria-hidden="true">#</a></h1><p>Global parameter management for the project.</p><h2 id="usage-and-built-in-parameters" tabindex="-1">Usage and built-in parameters <a class="header-anchor" href="#usage-and-built-in-parameters" aria-hidden="true">#</a></h2><p>In addition to the user-defined global parameters, Sonic also has some built-in parameters for random data construction.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>During the test process, the results of test steps such as [Get Text] can also be stored in temporary parameters, and can be referenced in the same way later to achieve the effect of parameter passing.</p></div><div><table><thead><tr><th>name</th><th>function</th><th>example</th><th>result</th></tr></thead><tbody><tr><td>random</td><td>random two-digit number</td><td>John has {{random}} children.</td><td>John has 32 children.</td></tr><tr><td>timestamp</td><td>current timestamp (13 digits)</td><td>current timestamp: {{timestamp}}</td><td>current timestamp: 1675172119000</td></tr><tr><td>random[number]</td><td>Random number with [number] digits (<strong>available after v2.3.0</strong>)</td><td>This is a random five-digit number: {{random[5]}}</td><td>This is a random five-digit number: 32354</td></tr><tr><td>random[Number-Number]</td><td>Randomly draw a digit between [Number] and [Number] (<strong>v2.3.0 version available</strong>)</td><td>She spent {{random[100-200]}} yuan</td><td>She spent 156 yuan</td></tr><tr><td>random[string|string|string...]</td><td>Randomly extract a string from the string separated by | in [] (*<em>v2.3.0 version available</em> *)</td><td>{{random[hello|123|???]}}</td><td>hello or 123 or???</td></tr><tr><td>The parameter name of the global parameter</td><td>Replace the text corresponding to the parameter name with the parameter value</td><td>hello, {{name}}</td><td>hello, sonic</td></tr></tbody></table></div><h2 id="special-usage" tabindex="-1">Special usage <a class="header-anchor" href="#special-usage" aria-hidden="true">#</a></h2><p>Generally, global parameters can be assigned to multiple runtime devices with the same parameter name.</p><div><p>Example: The parameter value of the Hello global parameter is 12|13|14. A use case step is 【Input Text】, and the text value is <code>abc{{Hello}}</code>.</p></div><p>Then, when executing the suite, if device coverage is selected, and the execution machines are Android machine A and Android machine B.</p><p>When step [Enter text] is executed, Android A will input <code>abc12</code>, and Android B will input <code>abc13</code>.</p><h2 id="add-global-parameters" tabindex="-1">Add global parameters <a class="header-anchor" href="#add-global-parameters" aria-hidden="true">#</a></h2><ol><li>Go to the home page and click the target item.</li><li>Click the [Test Data Management] option.</li><li>Click the [Global Parameters] option.</li><li>Click the [Add Global Parameter] button.</li><li>Enter the parameter name and parameter value. If there are multiple parameter values, they can be separated by |.</li><li>Click the [OK] button.</li><li>The global parameters are added!</li></ol><h2 id="edit-global-parameters" tabindex="-1">Edit global parameters <a class="header-anchor" href="#edit-global-parameters" aria-hidden="true">#</a></h2><ol><li>Go to the home page and click the target item.</li><li>Click the [Test Data Management] option.</li><li>Click the [Global Parameters] option.</li><li>Click the [Edit] button of the target parameter.</li><li>Edit the information you need to change.</li><li>Click the [OK] button.</li><li>The global parameters are edited!</li></ol><h2 id="delete-global-parameters" tabindex="-1">Delete global parameters <a class="header-anchor" href="#delete-global-parameters" aria-hidden="true">#</a></h2><ol><li>Go to the home page and click the target item.</li><li>Click the [Test Data Management] option.</li><li>Click the [Global Parameters] option.</li><li>Click the [Delete] button of the target parameter.</li><li>Click the [OK] button again.</li><li>Global parameters are deleted!</li></ol>',17),d=[i];function n(o,s,h,m,p,c){return t(),a("div",null,d)}const g=e(l,[["render",n]]);export{u as __pageData,g as default};
